    "sourceText": "const Rim = (diameter = 37, thickness = 2) =>\n  Arc(diameter)\n    .hasAngle(1 / 4)\n    .eachPoint((p) => p.Orb(thickness), ChainHull);",
    "sourceLocation": {
      "path": "nb/projects/pentacular/monocle/monocle.nb",
      "id": "Rim"
    }
  },
  {
    "hash": "8hy56CxgAPU7wqXsZlVTKZjW5yljrs5qK5L2dycaEBU=",
    "sourceText": "const Monocle = (\n  diameter = 37,\n  height = 11,\n  frameThickness = 2,\n  lensThickness = 2\n) =>\n  Rim(diameter, frameThickness)\n    .z(0)\n    .join(\n      'exact',\n      Hull(Arc(1.8, 3.6), Arc(3.6).z(height))\n        .join('exact', Orb(3.6, 3.6, 2).hasZag(0.5).z(height))\n        .x(37 / 2)\n        .rz(3 / 360, 3 / 8, 267 / 360)\n    )\n    .fitTo(\n      Arc(diameter)\n        .ez(height - lensThickness, height)\n        .mask(grow('z', 0.1))\n        .material('glass')\n        .as('lens')\n    )\n    .view()\n    .stl(\n      getNot('lens'),\n      `frame-${diameter}x${height}x${frameThickness}x${lensThickness}`\n    )\n    .stl(\n      get('lens'),\n      `lens-${diameter}x${height}x${frameThickness}x${lensThickness}`\n    );",
    "sourceLocation": {
      "path": "nb/projects/pentacular/monocle/monocle.nb",
      "id": "Monocle"
    }

    const prepareViews = async (notebook) => {
      // Prepare the view urls in the browser.
      for (const note of notebook) {
        if (note.view && !note.url) {
          note.url = await dataUrl(Shape.fromGeometry(note.data), note.view);
        }
      }
      return notebook;
    }

    const run = async () => {
      const body = document.getElementsByTagName('body')[0];
      const bookElement = document.createElement('div');
      const notebookElement = await toDomElement(await prepareViews(notebook));
      bookElement.appendChild(notebookElement);
      body.appendChild(bookElement);
      bookElement.classList.add('book', 'notebook', 'loaded');
    };

    if (document.readyState === 'complete') {
      run();
    } else {
      document.onreadystatechange = () => {
        if (document.readyState === 'complete') {
          run();
        }
      };
    }
